import React from "react";
import Link from 'next/link'

const Opinion1 = ({ data }) => {
  return (
    <div className="opinion1">
      <div className="blockheader"><span>Opinion</span></div>

      <ol>
        {data.opinion.map((news, index) => (
          <li>
            <Link href={news.url}>
              <a href="news/[[item.id]]">
                <h5>[[item.column]]</h5>
                <h6>[[item.author]]</h6>
                <h5 class="title">[[item.title]]</h5>
              </a>
            </Link>
          </li>
        ))}
      </ol>

    </div>
  )
}

export default Opinion1;
